import React from "react";
import logo from './logo.svg';
import './Main.css';
import Grid from '@material-ui/core/Grid';
import AnchorLink from 'react-anchor-link-smooth-scroll';
import Profile from './Profile.js';
//import picOpaaco from './static/media/picOpaaco.jpeg';
//import picCasulo from '.static/media/picCasulo.jpeg';
import Project from './Project.js';

class Main extends React.Component {
  render() {
    const bioMiguel = "Maker autodidacta e investigador del error. Mi trabajo se centra principalmente en el ámbito del arte tecnológico donde intento encontrar un balance entre la investigación y la creación de objetos y/o contenidos no palpables. Mis piezas son fruto de una dualidad en que se equilibra una voluntad por solucionar necesidades objetivas y técnicas, poniéndolas en contraste con visiones e interpretaciones desde una perspectiva subjetiva así como de perspectivas de creadores/as a mi alrededor. ";
    const bioSelvIkei = "";
    const bioOpaaco= "";
    const bioCasulo= "";
    return (
      <div id="page">
      <Grid item xs={12}>
        <Grid container>
            <Grid xs={2} id="menu" item>
              <p><a href="#casulo">casulo</a></p>
              <p><a href="#opaaco">opaaco</a></p>
              <p><a href="#selv_ikei">selv ikei</a></p>
            </Grid>
            <Grid xs={2} item>
              <div id="personas_projects">
              </div>
            </Grid>
            <Grid xs={7} item>
              <Profile
              name="miguel zurk cruz"
              picture="picSelvinho.jpeg"
              bio={bioMiguel}
              />
              <Profile
              name="casulo"
              picture="picCasulo.jpeg"
              bio={bioCasulo}
              />
              <Profile
              name="opaaco"
              picture="picCasulo.jpeg"
              bio={bioCasulo}
              />
              <Profile
              name="casulo"
              picture="picCasulo.jpeg"
              bio={bioCasulo}
              />
            </Grid>
        </Grid>
      </Grid>
      </div>
    );
  }
}

export default Main;
